import Navigator from "./component/NavBar";
import AdminNavbar from "./admin/AdminNavbar";

import { Route, BrowserRouter as Router, Routes } from "react-router-dom";

function App() {
  return (
    <div>
      {/* <Router>
        <Navigator />
      </Router> */}
      <Router>
        <Route path="/" element={<AdminNavbar/>}/>
      </Router>
    </div>
  );
}

export default App;
